  \"Trajectory Clustering with Applications to Airspace Monitoring\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:02:55.724793\",\n\t\"name\": \"trajectory-clustering-with-applications-to-airspace-monitoring\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This paper presents a framework aimed at
  monitoring the behavior of aircraft in a given airspace. Trajectories that constitute
  typical operations are determined and learned using data-driven methods. Standard
  procedures are used by air traffic controllers (ATCs) to guide aircraft, ensure
  the safety of the airspace, and maximize runway occupancy. Even though standard
  procedures are used by ATCs, control of the aircraft remains with the pilots, leading
  to large variability in the flight patterns observed. Two methods for identifying
  typical operations and their variability from recorded radar tracks are presented.
  This knowledge base is then used to monitor the conformance of current operations
  against operations previously identified as typical. A tool called AirTrajectoryMiner
  is presented, aiming at monitoring the instantaneous health of the airspace, in
  real time. The airspace is u201chealthyu201d when all aircraft are flying according
  to typical operations. A measure of complexity is introduced, measuring the conformance
  of current flight to typical flight patterns. When an aircraft does not conform,
  the complexity increases as more attention from ATC is required to ensure safe separation
  between aircraft.rnrnrnIEEE Transactions on Intelligent Transportation Systems,
  Dec. 2011, 12(4), pp. 1511 - 1524.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
